import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (

    <div className="App">
      <Navbar />
      <Footer />
    </div>
  );
}

function Navbar() {
  return (
    <div class="navbar"> 
      <ul class="navbar-left">
        <li>
          <a href="#" class="nav-item pl-3">Habbit Rabbit</a>
        </li>
      </ul>
      <ul class="navbar-right">
        <li class="nav-item">
          <a href="#" class="navbar-button">Home</a>
        </li>
        <li class="nav-item">
          <a href="#" class="navbar-button">About</a>
        </li>
        <li class="nav-item">
          <a href="#" class="navbar-button">Sign In</a>
        </li>
      </ul>
    </div>  
  );
}

function Footer() {
  return (
    <div class="footer">
      <ul class="navbar-upper">
        <li class="nav-item">
          <a href="#" class="navbar-button">Terms of Use</a>
        </li>
        <li class="nav-item">
          <a href="#" class="navbar-button">Privacy and Policy</a>
        </li>
        <li class="nav-item">
          <a href="#" class="navbar-button">Contact Us</a>
        </li>
      </ul>
      <ul class="navbar-lower">
        <li class="nav-item">
          <a href="#" class="navbar-button">Home</a>
        </li>
        <li class="nav-item">
          <a href="#" class="navbar-button">About</a>
        </li>
        <li class="nav-item">
          <a href="#" class="navbar-button">Sign In</a>
        </li>
      </ul>
    </div>
  );
}
export default App;
